import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { ethers } from 'ethers';
import { toast } from 'react-toastify';
import axios from 'axios';

const Navbar = () => {
  const navigate = useNavigate();
  const token = localStorage.getItem('token');
  const user = JSON.parse(localStorage.getItem('user'));
  const [walletAddress, setWalletAddress] = useState(user?.wallet_address || '');

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    navigate('/login');
  };

  const handleConnectWallet = async () => {
    try {
      if (!window.ethereum) {
        toast.error('Please install MetaMask to connect your wallet');
        return;
      }

      const provider = new ethers.BrowserProvider(window.ethereum);
      await provider.send('eth_requestAccounts', []);
      const signer = await provider.getSigner();
      const address = await signer.getAddress();

      const token = localStorage.getItem('token');
      await axios.post(
        'http://localhost:3000/api/connect-wallet',
        { wallet_address: address },
        { headers: { Authorization: `Bearer ${token}` } }
      );

      setWalletAddress(address);
      localStorage.setItem('user', JSON.stringify({ ...user, wallet_address: address }));
      toast.success('Wallet connected successfully!');
    } catch (err) {
      console.error('Connect wallet error:', err);
      toast.error('Failed to connect wallet');
    }
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <div className="container">
        <Link className="navbar-brand" to="/">blockHUNT</Link>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
          aria-controls="navbarNav"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav me-auto">
            <li className="nav-item">
              <Link className="nav-link" to="/hackathons">Hackathons</Link>
            </li>
            {token && user && (
              <>
                {user.role === 'organizer' && (
                  <>
                    <li className="nav-item">
                      <Link className="nav-link" to="/create-hackathon">Create Hackathon</Link>
                    </li>
                    <li className="nav-item">
                      <Link className="nav-link" to="/organizer-dashboard">Dashboard</Link>
                    </li>
                    <li className="nav-item">
                      <Link className="nav-link" to="/organizer-hackathons">My Hackathons</Link>
                    </li>
                  </>
                )}
              </>
            )}
          </ul>
          <ul className="navbar-nav">
            {token ? (
              <>
                {user.role === 'organizer' && !walletAddress && (
                  <li className="nav-item">
                    <button className="btn btn-outline-light me-2" onClick={handleConnectWallet}>
                      Connect Wallet
                    </button>
                  </li>
                )}
                {user.role === 'organizer' && walletAddress && (
                  <li className="nav-item">
                    <span className="nav-link text-light">
                      Wallet: {walletAddress.slice(0, 6)}...{walletAddress.slice(-4)}
                    </span>
                  </li>
                )}
                <li className="nav-item">
                  <Link className="nav-link" to="/user-profile">Profile</Link>
                </li>
                <li className="nav-item">
                  <button className="btn btn-outline-danger" onClick={handleLogout}>Logout</button>
                </li>
              </>
            ) : (
              <>
                <li className="nav-item">
                  <Link className="nav-link" to="/login">Login</Link>
                </li>
                <li className="nav-item">
                  <Link className="nav-link" to="/signup">Signup</Link>
                </li>
              </>
            )}
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
